import "./App.css"


export default class App extends Component {
constructor(props){
  super(props)
  this.state = {
    name: "",
    surname: "",
    schoolname: "",
    schoolstartdate: "",
    schoolfinishdate: "",
    workedas: "",
    startdate: "",
    finishdate: "",
    description: ""

  }
}

  render() {
    return (
      <div className='container'>
        <Identity />
        <Education/>
        <Work/>
        <Skills/>

      </div>
    )
  }
}
